  input: TEXT,F3XA,,"Per letter dated 12/31/02, Total listed on Lines 21(a)(i) and
    21(b) Column B of the Detailed Summary Page is now correct, had not uploaded report
    from previous amended report.  Schedule A Supporting Line 11(c) were usual and
    normal charges. The disclosed receipts for the Democratic Senatorial Campaign
    Commitee for 121,800.00 was in error, it was the Democratic Congressional Campaign
    Committee.  A entry was done on 11(a) (i) for the unitemized amt. for the Democratic
    National Committee Victory Fund. The Detailed Summary Page, On Line 18 Column
    A of the report is greater than the Line 21(a)(ii) Column A, includes transfers
    from previous reporting periods, transfers for shared activity was within the
    70 days, after the payment to the vendor. The DNC,DSCC and DCCC transfer in were
    not making any expenditures. Memo entries that were missing employer identification
    and occupation are below the 200.00 threshold.  Missing information for Michael
    Milligan has been altered."
